import React from "react";
import "./CartRoutes.scss";

interface RoutesProps {
  storeRow: string[];
}

const CartRoutes: React.FC<RoutesProps> = ({ storeRow }) => {

  storeRow = ["-", "-", "-", "-", "-","-", "-", "-", "-", "-","-", "-", "-", "-", "-","-", "-", "-", "-", "-","-", "-", "-", "-", "-","-", "-", "-", "-", "-",]
