      </div>
      <div className="mapTest LineTwo">
        {storeRow2.map((row, index) => (
          <div className={`spot ${index % 2 === 0 ? "odd" : "even"}`} key={index}>{row}</div>
        ))}
      </div>
      <div className="mapTest LineThree">
        {storeRow1.map((row, index) => (
          <div className={`spot ${index % 2 === 0 ? "even" : "odd"}`} key={index}>{row}</div>
        ))}
      </div>
      <div className="mapTest LineFour">
        {storeRow2.map((row, index) => (
          <div className={`spot ${index % 2 === 0 ? "odd" : "even"}`} key={index}>{row}</div>
        ))}
      </div>
      <div className="mapTest LineOne">
        {storeRow1.map((row, index) => (
          <div className={`spot ${index % 2 === 0 ? "even" : "odd"}`} key={index}>{row}</div>
        ))}
      </div>
      <div className="mapTest LineTwo">
        {storeRow2.map((row, index) => (
          <div className={`spot ${index % 2 === 0 ? "odd" : "even"}`} key={index}>{row}</div>
        ))}
      </div>
      <div className="mapTest LineOne">
        {storeRow1.map((row, index) => (
          <div className={`spot ${index % 2 === 0 ? "even" : "odd"}`} key={index}>{row}</div>
        ))}
      </div>
      <div className="mapTest LineTwo">
        {storeRow2.map((row, index) => (
          <div className={`spot ${index % 2 === 0 ? "odd" : "even"}`} key={index}>{row}</div>
        ))}
      </div>
      <div className="mapTest LineOne">
        {storeRow1.map((row, index) => (
          <div className={`spot ${index % 2 === 0 ? "even" : "odd"}`} key={index}>{row}</div>
        ))}
      </div>
      <div className="mapTest LineTwo">
        {storeRow2.map((row, index) => (
          <div className={`spot ${index % 2 === 0 ? "odd" : "even"}`} key={index}>{row}</div>
        ))}
      </div>

    </div>
  );
};

export default CartRoutes;
